##Estruras de Decisão (IF, ELSE, ELIF)
###1. Faça um programa que leia 2 notas de um aluno, calcule a média e imprima aprovado ou reprovado (para ser aprovado a média deve ser no mínimo 6)
# Lendo as duas notas do aluno
nota1 = float(input("Digite a primeira nota: "))
nota2 = float(input("Digite a segunda nota: "))

# Calculando a média
media = (nota1 + nota2) / 2

# Verificando se o aluno foi aprovado ou reprovado
if media >= 6:
    print("Aprovado!")
else:
    print("Reprovado!")

###2. Refaça o exercício 1, identificando o conceito aprovado (média superior a 6), exame (média entre 4 e 6) ou reprovado (média inferior a 4).
# Lendo as duas notas do aluno
nota1 = float(input("Digite a primeira nota: "))
nota2 = float(input("Digite a segunda nota: "))

# Calculando a média
media = (nota1 + nota2) / 2

# Verificando o conceito baseado na média
if media > 6:
    print("Aprovado!")
elif 4 <= media <= 6:
    print("Exame!")
else:
    print("Reprovado!")


##Estruturas de Repetição
###1. Escreva um programa que receba as notas dos alunos e armazene em uma lista. Ao receber '-1', finalize a leitura de notas e calcule a média da sala.
# 1. Programa para calcular a média das notas
notas = []
while True:
    nota = float(input("Digite a nota (-1 para sair): "))
    if nota == -1:
        break
    notas.append(nota)

if notas:
    media = sum(notas) / len(notas)
    print(f"Média da turma: {media:.2f}")
else:
    print("Nenhuma nota foi inserida.")

