###2. Crie uma função que receba como parâmetro uma lista, com valores de qualquer tipo. A função deve imprimir todos os elementos da lista numerando-os.
# 2. Função para imprimir elementos de uma lista numerados
def imprimir_lista(lista):
    for i, elemento in enumerate(lista, start=1):
        print(f"{i}. {elemento}")

# Exemplo de uso
itens = ["Maçã", "Banana", 42, True, 3.14]
imprimir_lista(itens)

#Revisão Listas, Tuplas e Dicionários.
##Em Python, listas, tuplas e dicionários são estruturas de dados muito utilizadas, mas possuem características e comportamentos diferentes. Vamos ver as principais diferenças entre elas:

##1. Listas (Lists)
###Sintaxe: São definidas com colchetes [].
###Mutabilidade: São mutáveis, ou seja, você pode alterar seus elementos depois de criá-las (adicionar, remover ou modificar elementos).
###Acesso: O acesso aos elementos é feito através de índices numéricos, começando de 0.
####Exemplo:

lista = [1, 2, 3, 4]
lista[0]  # Acessa o primeiro elemento: 1
lista[1] = 10  # Modifica o segundo elemento para 10

##2. Tuplas (Tuples)
###Sintaxe: São definidas com parênteses ().
###Mutabilidade: São imutáveis, ou seja, não é possível modificar, adicionar ou remover elementos depois que a tupla é criada.
###Acesso: O acesso aos elementos é feito através de índices numéricos, da mesma forma que nas listas.
####Exemplo:

tupla = (1, 2, 3, 4)
tupla[0]  # Acessa o primeiro elemento: 1
# tupla[1] = 10  # Vai gerar erro, pois tuplas são imutáveis

##3. Dicionários (Dictionaries)
###Sintaxe: São definidos com chaves {} e armazenam pares chave-valor.
###Mutabilidade: São mutáveis, ou seja, você pode adicionar, remover e modificar pares chave-valor.
###Acesso: O acesso aos elementos é feito através das chaves (não índices). Cada chave é única dentro do dicionário.
####Exemplo:

dicionario = {"chave1": 10, "chave2": 20}
dicionario["chave1"]  # Acessa o valor associado à "chave1": 10
dicionario["chave3"] = 30  # Adiciona uma nova chave-valor

